import React, { useState, useEffect, useCallback } from 'react';
import { Route, Routes, BrowserRouter, Link } from 'react-router-dom';
import styles from '../components/header.css';
import { useFilters } from '../../src/components/filtercontext';
import App from '../App';

const Header = ({ userSearch, setUserSearch, setShowModal }) => {
  const { setFilters } = useFilters();

  const handleFilterClick = (filter) => {
    setFilters(prevFilters => [...prevFilters, filter]);
  };

  const handleToggleClick = useCallback(() => {
    const navbarCollapse = document.getElementById('navbarSupportedContent');
    navbarCollapse.classList.toggle('show');
  }, []);

  useEffect(() => {
    const navbarToggler = document.getElementById('navbar-toggler');
    navbarToggler.addEventListener('click', handleToggleClick);

    return () => {
      navbarToggler.removeEventListener('click', handleToggleClick);
    };
  }, [handleToggleClick]);

  const handleSubmit = (e) => {
    e.preventDefault();
    // Add logic to handle the search functionality
    console.log('Search:', userSearch);
  };

  return (
    <BrowserRouter>
      <nav className={`navbar navbar-expand-lg ${styles['bg-body-tertiary']}`}>
        <div className="container-fluid">
          <Link className="navbar-brand" to="/">
            <h1 className={`text-primary m-0`} id="headtitle">
              <i className="fa fa-utensils me-3"></i>Restoran
            </h1>
          </Link>
          <button id="navbar-toggler" className="navbar-toggler" type="button" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav me-auto mb-2 mb-lg-0 justify-content-center w-100">
              <li className="nav-item">
                <Link className="nav-link active" aria-current="page" to="/">Brand</Link>
              </li>
              <li className="nav-item">
                <button className="nav-link btn" onClick={() => setShowModal(true)}>Search Locations</button>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/cart">Cart</Link>
              </li>
            </ul>
            <form className="d-flex" role="search" onSubmit={handleSubmit}>
              <input
                className="form-control me-2"
                value={userSearch}
                onChange={(e) => setUserSearch(e.target.value)}
                type="search"
                placeholder="Search Restaurants By Name"
                aria-label="Search"
              />
              <button className="btn btn-outline-success" id="searchbtn" type="submit">
                Search
              </button>
            </form>
            <div className="dropdown">
              <button className="btn btn-secondary dropdown-toggle" type="button" data-bs-toggle="dropdown" aria-expanded="false">
                Filters
              </button>
              <ul className="dropdown-menu">
                <li>
                  <button className="dropdown-item btn" onClick={() => handleFilterClick('fastDelivery')}>Fast Delivery</button>
                </li>
                <li>
                  <button className="dropdown-item btn" onClick={() => handleFilterClick('ratinghightolow')}>Rating: High to Low</button>
                </li>
                <li>
                  <button className="dropdown-item btn" onClick={() => handleFilterClick('ratinglowtohigh')}>Rating: Low to High</button>
                </li>
              </ul>
            </div>
          </div>
        </div>
      </nav>
      <Routes>
        <Route path="/" element={<App />} />
      </Routes>
    </BrowserRouter>
  );
};

export default Header;
